      min_ratio: 0
      max_ratio: 0.5
  - flagged_words_filter:
      lang: en
      tokenization: true
      max_ratio: 0.01
      use_words_aug: false
  - language_id_score_filter:
      lang: en
      min_score: 0.5
  - maximum_line_length_filter:
      min_len: 10
      max_len: 7328
  - perplexity_filter:
      lang: en
      max_ppl: 8000
  - special_characters_filter:
      min_ratio: 0
      max_ratio: 0.84
  - text_length_filter:
      min_len: 10
      max_len: 136028
  - words_num_filter:
      lang: en
      tokenization: true
      min_num: 20
      max_num: 23305
  - word_repetition_filter:
      lang: en
      tokenization: true
      rep_len: 10
      min_ratio: 0
      max_ratio: 0.6
  - document_simhash_deduplicator:
      tokenization: space
      window_size: 6
      lowercase: true
      ignore_pattern: ''''
      num_blocks: 6
      hamming_distance: 4
